  // }


  return (
    <Suspense fallback={ <Loading />  }>
    <div className="App"> 


      {/* <div id="loading" >  <Loading/> </div>  */}

      <Cover />

      <HashRouter>
        <Navigation />
      </HashRouter>

      <AboutSection/>
      <MySkills />
      <Projects id="project"/>
      <ClientsComment />
      <Services/>
      <Contact/>
      <Map/>
      <Footer/>




    </div>
    </Suspense>
  );
}

export default App;
